import React, { Fragment } from "react";

import * as showMessage from "./ShowMessage.module.css";

const ShowMessage = (props) => {
  return (
    <Fragment>
      <div class={showMessage.card}>
        <div class={showMessage["card-header"]}>Header Text</div>
        <div class={showMessage["card-content"]}>
          <p>
            Middle content goes here. This can be a long message or paragraph.
          </p>
        </div>
        <div class={showMessage["card-footer"]}>Secret Code: XYZ123</div>
      </div>
    </Fragment>
  );
};

export default ShowMessage;
